import QuoutDetail from "./pages/QuoutDetail";

function App() {
  return (
    <Layout>
      <Routes>
        <Route path="/" element={<AllQuouts/>}/>
        <Route path="/allQuouts/*" element={<AllQuouts/>}/>

            {/* <Route path='/' exact>
