            </Route>
            <Route path='/allQuouts/:quoutId' >
                <QuoutDetail/>
            </Route>
            <Route path='/addQuouts' >
                <NewQuout/>
            </Route>
            <Route path='*'>
              <NotFound/>
            </Route> */}
        </Routes>
    </Layout>
  );
}

export default App;
